svg.script:


var tl = gsap.timeline({repeat: -1, repeatDelay: 1, onStart: function(){

        document.getElementById('arrow_left').style.opacity = "0";
        document.getElementById('arrow_right').style.opacity = "0";
        document.getElementById('arrow_middle').style.opacity = "0";
}});

var t2 = gsap.timeline(
    {
        repeat: -1,
        repeatDelay: 1
    }
);

    t2.add(
            gsap.fromTo(
                        "#Group_3_2",
                                {
                                    rotation:0,
                                    transformOrigin:"bottom center"
                                },
                                {
                                    delay: 1.5,
                                    duration: 2.5,
                                    rotation:20,
                                    transformOrigin:"bottom center",
                                    ease:Linear.easeNone
                                }
                        )
            );

    t2.add(
            gsap.fromTo(
                        "#Group_3",
                                {
                                    rotation:20,
                                    transformOrigin:"bottom center"

                                },
                                {
                                    delay: 1.5,
                                    duration: 2.5,
                                    rotation:0,
                                    transformOrigin:"bottom center",
                                    ease:Linear.easeNone                        
                                }
                        )
            );

    tl.add(
            gsap.fromTo(
                        "#arrow_left",
                                {
                                    rotation:-20,
                                    opacity: 0,
                                    transformOrigin:"center center",
                                    delay: 0,
                                },
                                {
                                    duration: 1.5,
                                    rotation:0,
                                    opacity: 1,
                                    transformOrigin:"center center",
                                    delay: 0,
                                    ease:Linear.easeNone
                                }
                        )
            );

    tl.add(
            gsap.fromTo(
                        "#arrow_right",
                                {
                                    rotation:-20,
                                    opacity: 0,
                                    transformOrigin:"center center",
                                    delay: 1,
                                },
                                {
                                    duration: 1.5,
                                    rotation:0,
                                    opacity: 1,
                                    transformOrigin:"center center",
                                    delay: 0,
                                    ease:Linear.easeNone                        
                                }
                        )
            );

    tl.add(
            gsap.fromTo(
                        "#arrow_middle",
                                {
                                    rotation:-20,
                                    opacity: 0,
                                    transformOrigin:"center center",
                                    delay: 1.5,
                                },
                                {
                                    duration: 1.5,
                                    rotation:0,
                                    opacity: 1,
                                    transformOrigin:"center center",
                                    delay: 0,
                                    ease:Linear.easeNone                        
                                }
                        )
            );

    tl.add(
            gsap.fromTo(
                        "#arrow_middle",
                                {
                                    rotation:0,
                                    opacity: 1,
                                    transformOrigin:"center center",
                                    delay: 1,
                                },
                                {
                                    duration: 1.5,
                                    rotation:-20,
                                    opacity: 0,
                                    transformOrigin:"center center",
                                    delay: 1,
                                    ease:Linear.easeNone                        
                                }
                        )
            );

    tl.add(
            gsap.fromTo(
                        "#arrow_right",
                                {
                                    rotation:0,
                                    opacity: 1,
                                    transformOrigin:"center center",
                                    delay: 0,
                                },
                                {
                                    duration: 1.5,
                                    rotation:-20,
                                    opacity: 0,
                                    transformOrigin:"center center",
                                    ease:Linear.easeNone                        
                                }
                        )
            );

    tl.add(
            gsap.fromTo(
                        "#arrow_left",
                                {
                                    rotation:0,
                                    opacity: 1,
                                    transformOrigin:"center center",
                                    delay: 0,
                                },
                                {
                                    duration: 1.5,
                                    rotation:-20,
                                    opacity: 0,
                                    transformOrigin:"center center",
                                    ease:Linear.easeNone                        
                                }
                        )
            );
